import React from 'react';
import './Footer.scss';
import text from '../assets/text.png';

const Footer = () => {
    return(
        <div id='main-container'>
            <div id="inner-header">
                <div id='name'>
                    <div id='save'>
                       <img id="image-foot" src={text} alt="icon" />
                    </div>
                    <div id="plane"></div>
                </div>
                <div id='store'>

                </div>
            </div>
        </div>
    )
}

export default Footer;
